## Tooltip

A tooltip is a small box that appears when you hover over an element. It is used to provide additional information about the element.

## React Context

React Context is a way to pass data from a parent component to a child component without having to pass the data through every level of the component tree. It is useful for passing data that is needed by many components, such as theme data or user data.

## Creating a Tooltip in NextJS using React Context

To create a Tooltip in NextJS using React Context, we will first create a Tooltip component that will be used to render the tooltip. The Tooltip component will have the following props:

- `children`: The element that will trigger the tooltip.
- `content`: The content of the tooltip.
- `placement`: The position of the tooltip. It can be `top`, `right`, `bottom`, or `left`.

We will also create a TooltipContext component that will be used to manage the state of the tooltip. The TooltipContext component will have the following state:

- `activeTooltip`: The tooltip that is currently active.
- `setActiveTooltip`: A function to set the active tooltip.

We will use the `useContext` hook to access the state and the `useState` hook to manage the state.

Here is the code for the Tooltip component:

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, content, placement }) => {
  const { activeTooltip, setActiveTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    setActiveTooltip({ content, placement });
  };

  const handleMouseLeave = () => {
    setActiveTooltip(null);
  };

  return (
    <>
      <div
        onMouseEnter={handleMouseEnter}
        onMouseLeave={handleMouseLeave}
      >
        {children}
      </div>
      {activeTooltip && activeTooltip.content === content && (
        <div
          className={`tooltip ${activeTooltip.placement}`}
          style={{ top: placement === 'top' ? '-5px' : '', bottom: placement === 'bottom' ? '-5px' : '', left: placement === 'left' ? '-5px' : '', right: placement === 'right' ? '-5px' : '' }}
        >
          {activeTooltip.content}
        </div>
      )}
    </>
  );
};

export default Tooltip;
```

Here is the code for the TooltipContext component:

```jsx
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ activeTooltip, setActiveTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```

We can now use the Tooltip component in our NextJS application by wrapping our application with the TooltipProvider component. Here is an example of how to use the Tooltip component:

```jsx
import React from 'react';
import TooltipProvider from '../components/TooltipContext';
import Tooltip from '../components/Tooltip';

const HomePage = () => {
  return (
    <TooltipProvider>
      <div>
        <h1>Home Page</h1>
        <Tooltip content="This is a tooltip" placement="top">
          Hover over me
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default HomePage;
```

In this example, we are using the Tooltip component to render a tooltip that appears when you hover over the text "Hover over me". The tooltip is managed by the TooltipContext component, which is provided by the TooltipProvider component.

