If you mean that you want to use 0-3 pipes and 0-1 pays in your shell, then you can do that by using the `pipe` and `exec` functions in your shell.

Here is an example of how you might use the `pipe` function to create a pipe and the `exec` function to execute a command with its input connected to the pipe:
```
int pipefd[2];
pipe(pipefd);

pid_t pid = fork();
if (pid == 0) {
  // Child process
  close(pipefd[0]); // Close the read end of the pipe
  dup2(pipefd[1], STDOUT_FILENO); // Connect the write end of the pipe to stdout
  close(pipefd[1]); // Close the write end of the pipe

  execlp("ls", "ls", NULL); // Execute the "ls" command
} else {
  // Parent process
  close(pipefd[1]); // Close the write end of the pipe
  dup2(pipefd[0], STDIN_FILENO); // Connect the read end of the pipe to stdin
  close(pipefd[0]); // Close the read end of the pipe

  execlp("grep", "grep", "foo", NULL); // Execute the "grep foo" command
}
```
This will create a pipe, fork a child process, and execute the `ls` command in the child process with its output connected to the pipe. The parent process will then execute the `grep foo` command with its input connected to the pipe.

You can use multiple pipes and `exec` calls to create more complex pipelines with multiple commands. For example, you could use three pipes and three `exec` calls to create a pipeline that executes the `ls`, `grep foo`, and `sort` commands in sequence.

